                                        {data.map((_item) => _item?.gameNumber?.number + ',')}
                                    </td>
                                    <td>
                                        {data.map((_item) => _item?.gameNumber?.price + ',')}
                                    </td>

                                    <td>
                                        <Badge color="" className="badge-dot mr-4">
                                            {formatDate}
                                        </Badge>
                                    </td>
                                    <td>
